    false,nt"url": null,nt"notes": "Individual states can select season dates
    for migratory game birds within the given frameworks derived by the U.S. Fish &
    Wildlife Service (USFWS). The manner in which individual states set their season
    dates within the USFWS frameworks may not largely affect continental waterfowl populations,
    but it can greatly influence waterfowl hunter satisfaction. In 2010, Kansas modified
    its duck hunting zone boundaries, creating a 4th zone (See Appendix A for Kansas
    Duck Hunting Zones). Leading up to and since that change, there has been some contention
    in the selection of Kansas waterfowl hunting season dates, not only in the newly
    created zone but for all duck and goose season dates. To gather waterfowl huntersu2019
    preferences, Kansas Department of Wildlife, Parks and Tourism (KDWPT) conducted
    waterfowl hunter surveys in 2011, 2012, 2013, and again in 2014. The purpose of
    the 2014 survey was to garner Kansas waterfowl hunteru2019s preferences for season
    dates for Kansasu2019 2014-15 duck and goose seasons. In combination with other
    data streams such as waterfowl migration, waterfowl harvest and hunter participation,
    this survey will be used to assist Kansas waterfowl hunting season dates. This report
    summarizes the results of the KDWPT 2014 Waterfowl Hunter Survey.",nt"owner_org":
